import { Container, Texts, Content, TwShare, TwComment, TwRetweet, TwHeart, Dots, Profile, RightComponents, IconsSection } from './styles';

function Tweet(props) {

  const ConsId = id => {
    console.log(id)
  }

  return (
    <Container name={props.id} onClick={(e) => ConsId(e)}>
      <Profile>
        <img src="https://pbs.twimg.com/profile_images/1366383034119946240/H_a_dbyl_400x400.jpg" alt="profile"/>
      </Profile>
      <RightComponents>
        <Texts>
          <h1>nogs;</h1>
          <p>@wynogs</p>
          <Dots />
        </Texts>
        <Content>
          {props.text}
        </Content>
        <IconsSection>
          <TwComment/>
          <TwRetweet/>
          <TwHeart/>
          <TwShare/>
        </IconsSection>
      </RightComponents>
    </Container>
  );
}

export default Tweet;
